import React, { lazy, Suspense } from 'react';
const LazyEventCard = lazy(() => import('./EventCard'));

export function EventCardSuspense(props: React.ComponentProps<typeof LazyEventCard>) {
  return (
    <Suspense fallback={<div className="w-full h-48 bg-gray-100 animate-pulse rounded" />}>
      <LazyEventCard {...props} />
    </Suspense>
  );
}
